import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import SearchByArtist from "./SearchByArtist";

function App() {
  return (
    <Router>
      <div style={{ padding: "20px" }}>
        {/* Navigation bar */}
        <nav style={{ marginBottom: "20px" }}>
          <Link to="/" style={linkStyle}>
            Home
          </Link>
          {" | "}
          <Link to="/search-by-artist" style={linkStyle}>
            Search by Artist
          </Link>
        </nav>

        {/* Define routes */}
        <Routes>
          <Route
            path="/"
            element={<Home />}
          />
          <Route
            path="/search-by-artist"
            element={<SearchByArtist />}
          />
        </Routes>
      </div>
    </Router>
  );
}

// Home component
function Home() {
  return (
    <div>
      <h1>Welcome to the Music Search App</h1>
      <p>
        Use the navigation above to explore the features, such as searching for artists and songs.
      </p>
    </div>
  );
}

// Inline styling for links
const linkStyle = {
  textDecoration: "none",
  color: "blue",
  fontWeight: "bold",
};

export default App;
